  false,\n\t\"url\": null,\n\t\"notes\": \"NODC Accession 0115170 includes chemical,
  meteorological, physical and underway - surface data collected from NOAA Ship KA'IMIMOANA
  in the North Pacific Ocean and South Pacific Ocean from 2010-01-06 to 2010-09-17
  and retrieved during cruise 33KM20100106. These data include AIR-SEA DIFFERENCE
  - PARTIAL PRESSURE (OR FUGACITY) OF CARBON DIOXIDE, BAROMETRIC PRESSURE, CARBON
  DIOXIDE - AIR, Partial pressure (or fugacity) of carbon dioxide, SALINITY and SEA
  SURFACE TEMPERATURE. The instruments used to collect these data include Barometric
  pressure sensor, Carbon dioxide (CO2) gas analyzer, Shower head chamber equilibrator
  for autonomous carbon dioxide (CO2) measurement and thermosalinographs. These data
  were collected by Catherine E. Cosca, Richard A. Feely and Geoffrey T. Lebon of
  US DOC; NOAA; OAR; Pacific Marine Environmental Laboratory as part of the VOS NOAA
  Ship Ka'imimoana 2010 cruises data set.nnThe World Ocean Circulation Experiment
  (WOCE) was a major component of the World Climate Research Program with the overall
  goal of better understanding the ocean's role in climate and climatic changes resulting
  from both natural and anthropogenic causes. The CO2 survey took advantage of the
  sampling opportunities provided by the WOCE Hydrographic Program (WHP) cruises during
  this period between 1990 and 1998. The final collection covers approximately 23,000
  stations from 94 WOCE cruises.\",\n\t\"owner_org\": \"e811f0b4-451f-4896-9e8f-fc6802837819\",\n\t\"extras\":
